#include <vector>
#include <unordered_map>
#include <queue>
#include <iostream>

using namespace std;

class Solution {
public:
  vector<int> gardenNoAdj(int n, vector<vector<int>>& paths) {
    unordered_map<int, vector<int>> graph;
    for (auto edge : paths) {
      int src = edge[0] - 1;
      int dest = edge[1] - 1;
      graph[src].push_back(dest);
      graph[dest].push_back(src);
    }

    vector<int> types(n, 0);
    vector<bool> visited(n, false);
    queue<int> work;

    for (int i = 0; i < n; ++i) {
      if (types[i] == 0) {
	work.push(i);
	visited[i] = true;
      }

      while (work.size()) {
	int node = work.front();
	work.pop();
	vector<int> avail_types(5, 0);
	avail_types[0] = 1;
	for (int adj : graph[node]) {
	  if (visited[adj] == false) {
	    work.push(adj);
	    visited[adj] = true;
	  }
	  if (types[adj] != 0) {
	    avail_types[types[adj]] = 1;
	  }
	}
	int t = 0;
	for (t = 1; t <= 4; ++t) {
	  if (avail_types[t] == 0)
	    break;
	}
	if (t == 0)
	  return {-1};
	types[node] = t;
      }
    }

    return types;
  }
};

void print(vector<int> &in) {
  for (auto val : in) {
    cout << val << " ";
  }
  cout << endl;
}

